package week1.day1;

public class Primenumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int num=6;
for(int i=2;i<=num-1;i++) {
	if(num%1==0) {
		System.out.println("this is prime number");
	}
	else {
		System.out.println("not prime number");
	}
}
	}

}
